				if (xcoord >= 0) xcoord -= 10;
			} else if (e.code == "ArrowRight") {
				if (xcoord <= 920) xcoord += 10;
			} else {
				if (e.code == "Enter") {
					data.push([xcoord, altitude]);
					drawCrossSection();
				}
				return;
			}
			drawCircles();
		}

		function drawCircles() {
			ctx.clearRect(0, 0, 920, 727);
			ctx.drawImage(image, 0, 0);
			
			ctx.beginPath();
			ctx.fillStyle = "red";
			ctx.arc(xcoord + altitude, 300, 7, 0, 7);
			ctx.fill();

			ctx.beginPath();
			ctx.fillStyle = "cyan";
			ctx.arc(xcoord - altitude, 300, 7, 0, 7);
			ctx.fill();
		}

		function drawCrossSection() {
			plt.clearRect(0, 0, 920, 400);

			data.sort(function(first, second) {
				if (first[0] > second[0]) {
					return 1;
				} else if (first[0] < second[0]) {
					return -1;
				} else {
					return 0;
				}
			});
			
			if (data.length > 0) {
				plt.beginPath();
				plt.moveTo(0, 380);
				for (let coord of data) {
					plt.lineTo(coord[0], -coord[1] * 15 + 380);
				}
				plt.stroke();
			}
		}

		function exportData() {
			let result = "";
			for (let item of data) {
				result += `${item[0]}, ${item[1]}\n`;
			}
			
			let title = prompt("題名を入力してください", "断面図");
			let blob = new Blob([result], {type: "text/csv"});
			let link = document.createElement("a");
			link.href = URL.createObjectURL(blob);
			link.download = `${title}.csv`;
			link.click();
		}
	</script>
</body>
</html>
